import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Login from "./Components/Auth/Auth"; // Import your Login component
import Manager from "./Components/Pages/Manager"; // Import your Manager component
import Developer from "./"; // Import your Developer component
import QA from "./QA"; // Import your QA component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/Manager" element={<Manager />} />
        <Route path="/Developer" element={<Developer />} />
        <Route path="/QA" element={<QA />} />
      </Routes>
    </Router>
  );
}

export default App;
